import React, {Component} from 'react';

class Login extends Component {
    render() {
        return(
            <div>
                <div className='loginForm'>
                    <input type='text' className='id' placeholder='아이디'></input>
                    <input type='text' className='password' placeholder='비밀번호'></input>
                </div>
            </div>
        )
    }
}

export default Login;
